answer = waitTask();

function waitTask(){
	var snRec = new GlideRecord('x_655585_whmg_sn1');
	snRec.addQuery('u_ritm', current.sys_id);
	snRec.query();
	if(	snRec.next())
	{
		gs.addInfoMessage(snRec.getValue('u_ritm') + ' oggetto: ' + snRec.getValue('u_item'));
		gs.addInfoMessage(current.getDisplayValue('number') + ' oppure ' + current.number + ' oppure: ' + current.getValue('number'));
		return 'yes';
	}
	else
	{
		gs.addInfoMessage(snRec.getValue('u_ritm') + ' oggetto: ' + snRec.getValue('u_item'));
		return 'no';
	}
}

